%% ===== CREATE FIGURE =====
function hFig = CreateFigure(FigureId) %#ok<DEFNU>
    % Begin initialization code - DO NOT EDIT
    gui_Singleton = 0;
    gui_State = struct('gui_Name',       mfilename, ...
                       'gui_Singleton',  gui_Singleton, ...
                       'gui_OpeningFcn', @figure_mri_export_OpeningFcn, ...
                       'gui_OutputFcn',  @figure_mri_export_OutputFcn, ...
                       'gui_LayoutFcn',  @figure_mri_export_LayoutFcn, ...
                       'gui_Callback',   []);
    hFig = gui_mainfcn(gui_State, 'Visible', 'off');
    % Set renderer
    if (bst_get('DisableOpenGL') == 1)
        rendererName = 'zbuffer';
    else
        rendererName = 'opengl';
    end
    set(hFig, 'Renderer', rendererName);



%% =======================================================================================
%  ===== FIGURE CALLBACKS ================================================================
%  =======================================================================================
function figure_mri_export_OpeningFcn(hFig, ev, handles, varargin)
    figure_mri('figure_mri_OpeningFcn', hFig, ev, handles, varargin)
    
function varargout = figure_mri_export_OutputFcn(hFig, eventdata, handles)  %#ok<INUSL>
    % Get default command line output from handles structure
    varargout{1} = handles.output;


